import {React , useState} from 'react';

function T(){
  
    const [random , setRandom] = useState([]);
    let code = ()=>{
        setRandom([
            ...random,{
              id : random.length,
              value : Math.random()}
        ])
    }
    

    return(
        <section >
           <button onclick={code}></button>
           <ul>
            {random.map((e)=> {<li>{e.value}</li>})}
           </ul>
        </section>
        
    )
}
export default T ;
